    <div className="frame-27975">
      <div className="nature-lovers2 valign-text-middle">{natureLovers}</div>
      <p className="text-1022 valign-text-middle ibmplexsans-normal-quarter-spanish-white-16px">{text1022}</p>
      <div className="due-to-the-advantage3 valign-text-middle ibmplexsans-normal-monsoon-16px">
        {dueToTheAdvantage}
      </div>
    </div>
  );
}

export default Frame27973;
